          "__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   CARDS_DATA: () => (/* binding */ CARDS_DATA)\n/* harmony export */ });\nconst CARDS_DATA = [{\n  id: 'one',\n  title: 'Real Development',\n  content: 'It’s in the name. We do real development to solve real challenges. This isn’t a tutorial hell workshop, where you constantly watch a bunch of videos all the time and label yourself a developer on LinkedIn.',\n  fullContent: 'It’s in the name. We do real development to solve real challenges. This isn’t a tutorial hell workshop, where you constantly watch a bunch of videos all the time and label yourself a developer on LinkedIn.<br />We don’t do unfinished hobby projects here. Our code is peer reviewed, improved and the open source work that you do here is displayed on your member’s profile.<br />You are encouraged to show this profile to your potential recruiters, and this work is more credible because it’s deployed on production and has real users. You will learn debugging skills and improving performance and reliability of the products you make here.<br />You will be given real challenges, which are always slightly outside your comfort zone and current skills, so that you keep getting better.',\n  image: 'assets/images/cards/real-development.png'\n}, {\n  id: 'two',\n  title: 'Constant coaching and mentoring',\n  content: 'Our main mentor and coach, Ankush Dharkar, has been teaching people to solve engineering challenges and code for a long time. He is himself a full-stack developer, with heavy expertise on Frontend UI engineering.',\n  fullContent: 'Our main mentor and coach, Ankush Dharkar, has been teaching people to solve engineering challenges and code for a long time. He is himself a full-stack developer, with heavy expertise on Frontend UI engineering. He was involved with his own startup for more than 7 years, then worked at Disney+ Hotstar, was an instructor at career accelerator at Pesto Tech, and currently working at CrowdStrike.<br />You will always be tracked for updates on our status site, and we periodically remove our inactive participants. So, rest assured, there’s no dead-weight.<br />You will always have direction and goals on how to improve. You won’t be wasting time deciding what to build -- this is often a problem people don’t realize. People choose hobby projects they already know how to do. In real life, quite often you get new unforeseen challenges. We prepare you to tackle them head-on.',\n  image: 'assets/images/cards/constant-coaching.png'\n}, {\n  id: 'three',\n  title: 'Smart squad members',\n  content: 'All the members who you would work with, our highly active motivated and driven peer group that you can ask for. You may or may not have such a group at your workplace :). If you stay shy and don’t participate, you will be the one at loss.',\n  fullContent: 'You will work with other smart developers, some of them who started with almost no knowledge of coding or development. The only thing that makes them successful is commitment, persistence and willingness to admit things they do not know and do something about it. If you stay shy and don’t participate, you will be the one at loss.<br />All the members who you would work with, our highly active motivated and driven peer group that you can ask for. You may or may not have such a group at your workplace',\n  image: 'assets/images/cards/smart-squad-members.png'\n}, {\n  id: 'four',\n  title: 'Learning and Collaboration',\n  content: 'We share our experiences and knowledge, so you will learn far more and sooner than on your own. We pool and share our resources to ensure we are some of the best employees companies will come across.',\n  fullContent: 'We share our experiences and knowledge, so you will learn far more and sooner than on your own. We pool and share our resources to ensure we are some of the best employees companies will come across.',\n  image: 'assets/images/cards/learning.png'\n}, {\n  id: 'five',\n  title: 'Engineering for evolution',\n  content: 'We are not a one-trick pony. We do projects in a lot of technologies, including standard web technologies like HTML, CSS, JavaScript, React, Ember, Vue, Node, Go, Rust, and more. We don’t limit ourselves to one thing.',\n  fullContent: 'We are not a one-trick pony. We do projects in a lot of technologies, including standard web technologies like HTML, CSS, JavaScript, React, Ember, Vue, Node, Go, Rust, and more.<br />We don’t limit ourselves to one thing. We focus on building amazing basic foundations and then adapting and learning whatever tech or tool we have to in order to engineer the best solutions to problems.<br />We are engineers and problem solvers, not the kind of people who will become outdated with time.',\n  image: 'assets/images/cards/engineering-for-evolution.png'\n}, {\n  id: 'six',\n  title: 'Soft Skills',\n  content: 'Being successful in career is much more than just knowing how to push keys and click around. We ensure that you are the kind of person who is great at communication skills: Both Written and Spoken.',\n  fullContent: 'Being successful in career is much more than just knowing how to push keys and click around. We ensure that you are the kind of person who is great at communication skills: Both Written and Spoken.<br />We are ourselves a fun group, who believe in helping each other. You will have a good time!',\n  image: 'assets/images/cards/soft-skills.png'\n}];\n\n//# sourceURL=webpack://website-www/./tests/constants/cards-data.js?",
